import React from "react";
import { useParams, Link } from "react-router-dom";
import "./App.css";

function ProjectDetails() {
  const { id } = useParams();

  return (
    <div className="project-page">

      <Link to="/" className="back-btn">‚Üê Back to Home</Link>

      <div className="project-container">

        {id === "resume" && (
          <>
            <h1 className="project-title">AI Based Resume Builder</h1>
            <p className="project-description">
              The AI-Based Resume Builder helps users create ATS-friendly
              resumes using Artificial Intelligence and Machine Learning.
              It generates optimized summaries, matches job keywords,
              and improves resume quality with smart suggestions.
            </p>
          </>
        )}

        {id === "retinopathy" && (
          <>
            <h1 className="project-title">
              Diabetic Retinopathy Detection System
            </h1>
            <p className="project-description">
              This system uses a hybrid DenseNet201 + ResNet50 deep learning
              model to analyze retinal images and detect diabetic retinopathy.
              It provides prediction results along with confidence scores
              for accurate medical AI demonstrations.
            </p>
          </>
        )}

      </div>
    </div>
  );
}

export default ProjectDetails;
